import React from 'react';
import './styles.css';
import IFood from '../../assets/IFoodLogo.svg';
import { FiStar, FiLogIn } from 'react-icons/fi'
const Login: React.FC = () => {
    return(
        <>
                <ul className="menu">
                    <li className="options-menu"><a href="#">Pagina Inicial</a></li>
                    <li className="options-menu"><a href="#">Cadastre-se</a></li>
                    <li className="options-menu"><a href="#">Fazer Login</a></li>
                    <li className="options-menu"><a href="#">Sobre o sistema</a></li>
                </ul>


            <div className="image">
                <img src={IFood} alt="Logo IFood"/>
            </div>

            <form>
                <input type="text" placeholder="CPF"/>
                <input type="password" placeholder="Senha"/>
                <button>Login</button>
                <div className="links">
                    <a href="#"><FiStar size={15} color={"#FF0000"}/><p>Sou um funcionário</p></a>
                    <a href="#"><FiLogIn size={15} color={"#F00000"}/><p>Não possuo Login</p></a>
                </div>
            </form>

        </>
    );
}

export default Login;
